Aplikacija zahvaljujući kojoj je moguće pratiti realizaciju projekta „Sakupljanje i prečišćavanje otpadnih voda Podgorica“. Na jednom mjestu su svi podaci o relevantnim aspektima za građane:
·   	Faze projekta;
·   	Aktivni radovi na svim lokacijama;
·   	Rokovi za izvršenje;
·   	Novosti;
·       Podaci o značaju, nosiocima i partnerima;
Projekat „Sakupljanje i prečišćavanje otpadnih voda Podgorica“ obuhvata izgradnju Postrojenja za prečišćavanje otpadnih voda sa pripadajućom kolektorskom mrežom i predstavlja primarni projekat sa aspekta održivog razvoja Glavnog grada Podgorice.
Njime se obezbjeđuju preduslovi za ubrzan razvoj Glavnog grada u narednih 50 godina. 
Po svom značaju može se definisati kao regionalni i državni projekat. 
Ukoliko vam je potrebna pomoć ili imate neku sugestiju, pišite nam na info@ovpg.me.
